import ExpenseItem from "./components/ExpenseItem";
import "./Expenses.css";

function Expenses(props) {
  return (
    <div>
      <ExpenseItem
        title={props.expenses[0].title}
        amount={props.expenses[0].amount}
        date={props.expenses[0].date}
      />
      <ExpenseItem />
      <ExpenseItem />
      <ExpenseItem />
    </div>
  );
}
